import axios from 'axios'
import  {LOAN_VALUE,ERROR} from './actionTypes'
import * as community from '../data/community.json'

    export const communityAction = () => dispatch => {
    
        fetch('/')
        .then(res => dispatch({
            type: LOAN_VALUE,
            payload: community
    }),
        
        
        )
        .catch(err => dispatch({ type: ERROR, payload: err }))
    }
